$client = new \Google_Client();
$client->setApplicationName($_GOOGLE_APPNAME);
$client->setDeveloperKey($_GOOGLE_DEVKEY);

// open csv
$file = fopen("bot_images3.csv","w");
fputcsv($file, ["bot", "image"]);

// get images and misc
foreach ($aux_normalizedname_link_directimage as $entry) {
    $bot = $entry[0];
    $img = '';

    $service = new \Google_Service_Customsearch($client);

    // Do the query
    $query = $bot;
    $optParams = array(
        'num' => '10',
        'exactTerms' => $bot,
        'orTerms' => $bot,
        'cx' => $_GOOGLE_SEARCHENGINE_ID, //Added your cx or search engine ID here, see https://cse.google.com/cse/
    );

    try {
        /** @var \Google_Service_Customsearch_Search $results */
        $results = $service->cse->listCse($query, $optParams);

        foreach($results->getItems() as $k => $item){
            $title = $item->getTitle();
            $page_map = $item->getPagemap();
            $aux = ' - Home | Facebook';
            $nospace = str_replace(' ','', $query);

            if(strtolower($title) == strtolower($query)){
                $img = $page_map['cse_image'][0]['src'];
                break;
            } elseif (strtolower($title) == strtolower($query.$aux) || strtolower($title) == strtolower($nospace.$aux)) {
                // indentify bad names
                if(strtolower($title) == strtolower($nospace.$aux)){
                    $bot = $bot.'[diff]';
                }
                $img = $page_map['cse_image'][0]['src'];
                break;
            }
            else {
                $aux = $page_map['metatags'][0]['og:title'];
                if(strtolower($aux) == strtolower($query)){
                    $img = $page_map['cse_image'][0]['src'];
                    break;
                }
            }
        }

        // L#701
        try {

            // Remove anything which isn't a word, whitespace, number
            // or any of the following caracters -_~,;[]().
            $filename = preg_replace("([^\w\s\d\-_~,;\[\]\(\).])", '', $bot);
            // Remove any runs of periods (thanks falstro!)
            $filename = preg_replace("([\.]{2,})", '', $filename);

            $IMAGE_PATH_NEW = 'C:\Users\Diego\PhpstormProjects\BotStatusBot\tests\bot images\\'.$filename.'.png';

            $ImgFetcher = new BotStatusBot\ImageFetcher();
            $isSuccess = $ImgFetcher->saveImageLocally($img, $IMAGE_PATH_NEW, false);
            if (!$isSuccess) {
                $message = $bot.' failed.';
                $dt->logdata($message);
            }
        } catch (Exception $e) {
            $message = $bot.' failed bc exception.'.$e->getMessage();
            $dt->logdata($message);
        }

        // dump it to csv
        fputcsv($file, [$bot, $img]);

    } catch (Exception $e) {
        $message = $bot.' failed bc exception.'.$e->getMessage();
        $dt->logdata($message);
    }

}

// close csv
fclose($file);
